import { Button } from "@material-ui/core";
import React from "react";
import { Link } from "react-router-dom";

const Option = () => {
  return (
    <>
    <Link></Link>
      <Button>Тест по java</Button>
      <Button>Тест по react</Button>
    </>
  );
};

export default Option;
